import React from 'react';
import { Row, Col } from 'antd';
import AvatarSettingView from '../AvatarSettingView';
import FormSettingView from './../FormSettingView';

export default function BasicSetting() {
    return (
        <Row gutter={[16, 16]}>
            <Col xl={5} lg={5} md={6} sm={24} xs={24} style={{border: '1px solid blue'}}>
                <AvatarSettingView />
            </Col>
            <Col xl={19} lg={19} md={18} sm={24} xs={24}>
                <FormSettingView />
            </Col>
        </Row>
    );
}
